import React, { useState } from 'react';

interface ServiceSummary {
  service: string;
  date: string;
  nextStep: string;
  notes: string;
}

interface FormData {
  basic: {
    organizationName: string;
    navigatorName: string;
    intakeDate: string;
  };
  participant: {
    firstName: string;
    middleName: string;
    lastName: string;
    dateOfBirth: string;
    gender: string;
    countryOfOrigin: string;
    preferredLanguage: string;
    phoneNumber: string;
    email: string;
    streetAddress: string;
    city: string;
    state: string;
    zipCode: string;
    county: string;
    mailingAddress: string;
    sameAsResidential: boolean;
    dshsClientId: string;
    alienNumber: string;
  };
  immigration: {
    status: string;
    eligibilityDate: string;
    refugee: boolean;
    asylum: boolean;
    cubanHaitian: boolean;
    amerasian: boolean;
    humanTrafficking: boolean;
    afghanIraqi: boolean;
    afghanParolee: boolean;
    afghanSpecialParole: boolean;
    ukrainianParolee: boolean;
  };
  eligibility: {
    receivingServices: boolean;
    isOver16: boolean;
    livesInWashington: boolean;
    arrivedAfterJuly2021: boolean;
    hasApprovedStatus: boolean;
    consentFormCompleted: boolean;
    releaseFormCompleted: boolean;
    statusCopyCollected: boolean;
  };
  household: {
    isHead: boolean;
    relationshipToHead: string;
    members: Array<any>;
  };
  services: {
    outreach: boolean;
    communityOrientation: boolean;
    informationReferrals: boolean;
    resourceNavigation: boolean;
    supportServices: boolean;
    other: boolean;
    otherDescription: string;
    summary: ServiceSummary[];
  };
}

const CommunityIntakeForm: React.FC = () => {
  const [formData, setFormData] = useState<FormData>({
    basic: {
      organizationName: '',
      navigatorName: '',
      intakeDate: ''
    },
    participant: {
      firstName: '',
      middleName: '',
      lastName: '',
      dateOfBirth: '',
      gender: '',
      countryOfOrigin: '',
      preferredLanguage: '',
      phoneNumber: '',
      email: '',
      streetAddress: '',
      city: '',
      state: 'Washington',
      zipCode: '',
      county: '',
      mailingAddress: '',
      sameAsResidential: false,
      dshsClientId: '',
      alienNumber: ''
    },
    immigration: {
      status: '',
      eligibilityDate: '',
      refugee: false,
      asylum: false,
      cubanHaitian: false,
      amerasian: false,
      humanTrafficking: false,
      afghanIraqi: false,
      afghanParolee: false,
      afghanSpecialParole: false,
      ukrainianParolee: false
    },
    eligibility: {
      receivingServices: false,
      isOver16: false,
      livesInWashington: false,
      arrivedAfterJuly2021: false,
      hasApprovedStatus: false,
      consentFormCompleted: false,
      releaseFormCompleted: false,
      statusCopyCollected: false
    },
    household: {
      isHead: false,
      relationshipToHead: '',
      members: []
    },
    services: {
      outreach: false,
      communityOrientation: false,
      informationReferrals: false,
      resourceNavigation: false,
      supportServices: false,
      other: false,
      otherDescription: '',
      summary: []
    }
  });

  // Rest of your component code stays the same, just add the types where needed
  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value, type, checked } = e.target;
    const [section, field] = name.split('.');

    setFormData(prev => ({
      ...prev,
      [section]: {
        ...prev[section as keyof FormData],
        [field]: type === 'checkbox' ? checked : value
      }
    }));
  };

  const addServiceSummary = () => {
    setFormData(prev => ({
      ...prev,
      services: {
        ...prev.services,
        summary: [
          ...prev.services.summary,
          { service: '', date: '', nextStep: '', notes: '' }
        ]
      }
    }));
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    console.log('Form submitted:', formData);
  };

  return (
    <div className="max-w-4xl mx-auto p-6">
      <h1 className="text-2xl font-bold text-center mb-8">Community Outreach and Education Intake/Registration Form</h1>

      <form onSubmit={handleSubmit} className="space-y-8">
        {/* Basic Information */}
        <section className="border p-4 rounded">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <div>
              <label className="block text-sm font-medium mb-1">Organization Name</label>
              <input
                type="text"
                name="basic.organizationName"
                value={formData.basic.organizationName}
                onChange={handleChange}
                className="w-full p-2 border rounded"
              />
            </div>
            <div>
              <label className="block text-sm font-medium mb-1">Navigator Name</label>
              <input
                type="text"
                name="basic.navigatorName"
                value={formData.basic.navigatorName}
                onChange={handleChange}
                className="w-full p-2 border rounded"
              />
            </div>
            <div>
              <label className="block text-sm font-medium mb-1">Intake Date</label>
              <input
                type="date"
                name="basic.intakeDate"
                value={formData.basic.intakeDate}
                onChange={handleChange}
                className="w-full p-2 border rounded"
              />
            </div>
          </div>
        </section>

        {/* Immigration Status */}
        <section className="border p-4 rounded">
          <h2 className="text-xl font-semibold mb-4">Current Immigration Status</h2>
          <div className="space-y-2">
            {[
              { key: 'refugee', label: 'Refugee' },
              { key: 'asylum', label: 'Asylum (Approved and granted)' },
              { key: 'cubanHaitian', label: 'Cuban and Haitian entrants' },
              { key: 'amerasian', label: 'Amerasians' },
              { key: 'humanTrafficking', label: 'Certified victims of human trafficking' },
              { key: 'afghanIraqi', label: 'Iraqi and Afghan Special Immigrants' },
              { key: 'afghanParolee', label: 'Afghan Humanitarian Parolees' },
              { key: 'afghanSpecialParole', label: 'Afghans with Special Immigrant Parole' },
              { key: 'ukrainianParolee', label: 'Ukrainian Humanitarian Parolees' }
            ].map(status => (
              <label key={status.key} className="flex items-center">
                <input
                  type="checkbox"
                  name={`immigration.${status.key}`}
                  checked={formData.immigration[status.key as keyof typeof formData.immigration] as boolean}
                  onChange={handleChange}
                  className="mr-2"
                />
                <span>{status.label}</span>
              </label>
            ))}
          </div>
        </section>

        {/* Program Eligibility */}
        <section className="border p-4 rounded">
          <h2 className="text-xl font-semibold mb-4">Program Eligibility Determination</h2>
          <div className="space-y-2">
            {[
              { key: 'receivingServices', label: 'Is participant receiving services from resettlement agencies?' },
              { key: 'isOver16', label: 'Is participant 16 years of age or older?' },
              { key: 'livesInWashington', label: 'Does participant live in Washington?' },
              { key: 'arrivedAfterJuly2021', label: 'Did participant arrive after July 1, 2021?' }
            ].map(item => (
              <label key={item.key} className="flex items-center">
                <input
                  type="checkbox"
                  name={`eligibility.${item.key}`}
                  checked={formData.eligibility[item.key as keyof typeof formData.eligibility]}
                  onChange={handleChange}
                  className="mr-2"
                />
                <span>{item.label}</span>
              </label>
            ))}
          </div>
        </section>

        {/* Services */}
        <section className="border p-4 rounded">
          <h2 className="text-xl font-semibold mb-4">Services</h2>
          <div className="space-y-2">
            {[
              { key: 'outreach', label: 'Outreach' },
              { key: 'communityOrientation', label: 'Community & Cultural Orientation and Educational Workshops' },
              { key: 'informationReferrals', label: 'Information and Referrals' },
              { key: 'resourceNavigation', label: 'Resource Navigation' },
              { key: 'supportServices', label: 'Support Services' }
            ].map(service => (
              <label key={service.key} className="flex items-center">
                <input
                  type="checkbox"
                  name={`services.${service.key}`}
                  checked={formData.services[service.key as keyof typeof formData.services] as boolean}
                  onChange={handleChange}
                  className="mr-2"
                />
                <span>{service.label}</span>
              </label>
            ))}
          </div>

          {/* Service Summary Table */}
          <div className="mt-6">
            <h3 className="font-medium mb-2">Service Summary</h3>
            <table className="w-full border-collapse">
              <thead>
                <tr>
                  <th className="border p-2">Services provided</th>
                  <th className="border p-2">Date</th>
                  <th className="border p-2">Next Step</th>
                  <th className="border p-2">Notes</th>
                </tr>
              </thead>
              <tbody>
                {formData.services.summary.map((entry, index) => (
                  <tr key={index}>
                    <td className="border p-2">
                      <input
                        type="text"
                        value={entry.service}
                        onChange={e => {
                          const newSummary = [...formData.services.summary];
                          newSummary[index] = { ...newSummary[index], service: e.target.value };
                          setFormData(prev => ({
                            ...prev,
                            services: { ...prev.services, summary: newSummary }
                          }));
                        }}
                        className="w-full p-1"
                      />
                    </td>
                    <td className="border p-2">
                      <input
                        type="date"
                        value={entry.date}
                        onChange={e => {
                          const newSummary = [...formData.services.summary];
                          newSummary[index] = { ...newSummary[index], date: e.target.value };
                          setFormData(prev => ({
                            ...prev,
                            services: { ...prev.services, summary: newSummary }
                          }));
                        }}
                        className="w-full p-1"
                      />
                    </td>
                    <td className="border p-2">
                      <input
                        type="text"
                        value={entry.nextStep}
                        onChange={e => {
                          const newSummary = [...formData.services.summary];
                          newSummary[index] = { ...newSummary[index], nextStep: e.target.value };
                          setFormData(prev => ({
                            ...prev,
                            services: { ...prev.services, summary: newSummary }
                          }));
                        }}
                        className="w-full p-1"
                      />
                    </td>
                    <td className="border p-2">
                      <input
                        type="text"
                        value={entry.notes}
                        onChange={e => {
                          const newSummary = [...formData.services.summary];
                          newSummary[index] = { ...newSummary[index], notes: e.target.value };
                          setFormData(prev => ({
                            ...prev,
                            services: { ...prev.services, summary: newSummary }
                          }));
                        }}
                        className="w-full p-1"
                      />
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
            <button
              type="button"
              onClick={addServiceSummary}
              className="mt-2 bg-blue-500 text-white px-4 py-2 rounded"
            >
              Add Service Entry
            </button>
          </div>
        </section>

        <button
          type="submit"
          className="w-full bg-blue-600 text-white py-2 px-4 rounded hover:bg-blue-700"
        >
          Submit Form
        </button>
      </form>
    </div>
  );
};

export default CommunityIntakeForm;
